rz = tp(wf, uh, ui, wg, adt);
sa = tp(wf, uh, ui, wg, tk);
or = distance(adu, adv);
ado = ug(wf, uh, ui, wg, 1.0);
adp = ug(wf, uh, ui, wg, adt);
adq = ug(wf, uh, ui, wg, tk);
